import React, {useContext} from 'react';
import HeroCard from "./HeroCard";
import {Context} from "../index";

const HeroList = () => {
    const {hero} = useContext(Context)
    return (
        <div>
            <div>abooba</div>
            {hero.heroes.map(hero =>
                <HeroCard key={hero.id} hero={hero}/>
            )}
        </div>
    );
};

export default HeroList;
